let Users = (props) => {
    return (
        <div>
            {
                props.users.map(u => <div key={u.id}>
                    <span>
                        <div>
                            <img src="" alt=""/>
                        </div>
                    </span>
                    <span>
                        <button>Follow</button>
                    </span>
                </div>)
            }
        </div>
    )
}

export default Users;
